import React, { useState, useEffect } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import axios from "axios";
import AsideBar from "./common/AsideBar";
// import { Redirect } from "react-router-dom";
import Footer from "./common/Footer";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";

const AddartCollectionss = ({ auth: { user } }) => {
  const [MoralisServerURL, setartMoralisServerURL] = useState("");
  const [MoralisApplicationID, setMoralisApplicationID] = useState("");
  const [ContractAddress, setContractAddress] = useState("");
  const [AdminAddress, setAdminAddress] = useState("");
  const [Fee, setFee] = useState("");
  const [Chain, setChain] = useState("");
  const [ExplorerURL, setExplorerURL] = useState("");

  // const history = useHistory();

  const setserverURL = (e) => {
    const { value } = e.target;
    setartMoralisServerURL(value);
  };

  const setAppID = (e) => {
    const { value } = e.target;
    setMoralisApplicationID(value);
  };

  const setAddress = (e) => {
    const { value } = e.target;
    setContractAddress(value);
  };

  const setadmnaddress = (e) => {
    const { value } = e.target;
    setAdminAddress(value);
  };

  const setFees = (e) => {
    const { value } = e.target;
    setFee(value);
  };

  const setchain = (e) => {
    const { value } = e.target;
    setChain(value);
  };

  const setExpURL = (e) => {
    const { value } = e.target;
    setExplorerURL(value);
  };




  // adduser data

  const [categoryData, setcategoryData] = useState([]);

  const getcategoryData = async () => {
    try {
      const resp = await axios.get("http://localhost:5000/Fetch-Categories");
      setcategoryData(resp.data);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    getcategoryData();
  }, []);

  const addUserData = async (e) => {
    e.preventDefault();

    var formData = new FormData();
    formData.append("MoralisServerURL", MoralisServerURL);
    formData.append("MoralisApplicationID", MoralisApplicationID);
    formData.append("ContractAddress", ContractAddress);
    formData.append("AdminAddress", AdminAddress);
    formData.append("Fee", Fee);
    formData.append("Chain", Chain);
    formData.append("ExplorerURL", ExplorerURL);

    const config = {
      headers: {
        "Content-Type": "multipart/form-data",
      },
    };

    await axios
      .post("http://localhost:5000/Add-Arts", formData, config)
      .then(() => alert("artCollections Added"))
      .catch((err) => alert(err));
  };

  return (
    <div className="wrapper">
      <div>
        <nav className="main-header navbar navbar-expand navbar-white navbar-light">
          <ul className="navbar-nav">
            <li className="nav-item">
              <a
                className="nav-link"
                data-widget="pushmenu"
                href="#/"
                role="button"
              >
                <i className="fas fa-bars" />
              </a>
            </li>
            <li className="nav-item d-none d-sm-inline-block">
              <a href="index3.html" className="nav-link">
                Home
              </a>
            </li>
            <li className="nav-item d-none d-sm-inline-block"></li>
          </ul>
          <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <a
                className="nav-link"
                data-widget="navbar-search"
                href="#/"
                role="button"
              >
                <i className="fas fa-search" />
              </a>
              <div className="navbar-search-block">
                <form className="form-inline">
                  <div className="input-group input-group-sm">
                    <input
                      className="form-control form-control-navbar"
                      type="search"
                      placeholder="Search"
                      aria-label="Search"
                    />
                    <div className="input-group-append">
                      <button className="btn btn-navbar" type="submit">
                        <i className="fas fa-search" />
                      </button>
                      <button
                        className="btn btn-navbar"
                        type="button"
                        data-widget="navbar-search"
                      >
                        <i className="fas fa-times" />
                      </button>
                    </div>
                  </div>
                </form>
              </div>
            </li>

            <li className="nav-item dropdown">
              <a className="nav-link" data-toggle="dropdown" href="#/">
                <i className="fa fa-user" />
              </a>
              <div className="dropdown-menu dropdown-menu-lg dropdown-menu-right">
                <div style={{ marginTop: "", textAlign: "center" }}>
                  <h5>Welcome, {user && user.name}</h5>
                </div>
              </div>
            </li>
          </ul>
        </nav>
      </div>
      <div>
        <AsideBar />
      </div>
      <div className="content-wrapper">
        <div className="content-header">
          <div className="container-fluid">
            <div className="row mb-2">
              <div className="col-sm-6">
                <h1 className="m-0">NFT Settings</h1>
              </div>
            </div>
          </div>
        </div>
        <section className="content">
          <div className="container-fluid">
            <div className="row">
              <Form className="mt-3">
                <Form.Group className="mb-3" controlId="formBasicEmail">
                  <Form.Label>Moralis Server URL</Form.Label>
                  <Form.Control
                    type="text"
                    name="MoralisServerURL"
                    onChange={setserverURL}
                    placeholder="Moralis Server URL"
                  />
                </Form.Group>

